class SolutionA:
    def lengthOfLongestSubstring(self, s: str) -> int:
        maxSize = 0
        substrings = {}
        for i in range(0, len(s)):
            for j in range(i, len(s)):
                # Get valid substring
                if s[i:j+1] in substrings:  
                    # Already checked.
                    continue
                else:
                    for c in s[i:j+1]:
                        if s[i:j+1].count(c) > 1:
                            break
                        else:
                            maxSize = max(maxSize, j-i+1)
                    substrings[str.join("", s[i:j+1])] = maxSize
        print(substrings)
        return maxSize

from functools import lru_cache

# abc 
# ab -> 2
# a -> 1

class SolutionB:
    # With memoization
    #@lru_cache(maxsize=128)
    def _lols(self, s: str, memo: list, i: int, j: int) -> int:
        if memo[i][j] > 0:
            return memo[i][j]

        # Base case
        size = 1
        if j-i > 1:
            size = self._lols(s, memo, i, j-1)

        if s[j] not in s[i:j]:
            size += 1
       
        memo[i][j] = size
        print(s[i:j+1] + " -> " + str(size))

        return size
        
    def lengthOfLongestSubstring(self, s: str) -> int:
        memo = []
        for i in range(0, len(s)):
            memo.append([])
            for _ in range(0, len(s)):
                memo[i].append(0)

        print(memo)

        maxSize = 0
        for i in range(0, len(s)-1):
            for j in range(i+1, len(s)):
                maxSize = max(self._lols(s, memo, i, j), maxSize)

        return maxSize

class SolutionC:
    def lengthOfLongestSubstring(self, s: str) -> int:
        left = max_length = 0
        char_set = set()

        for right in range(len(s)):
            while s[right] in char_set:
                char_set.remove(s[left])
                left += 1

            char_set.add(s[right])
            max_length = max(max_length, right - left + 1)

        return max_length

sol = SolutionC()

# Should be 3
print("abcabcbb -> ", sol.lengthOfLongestSubstring("abcabcbb"))

# Should be 1
print("bbbbb -> ", sol.lengthOfLongestSubstring("bbbbb"))

